window.bookSummaryJSON = "<p><b>Tall, dark, and deadly, these men run Walker Security. Each is unique in his methods and skills, but all share key similarities. They are passionate about those they love, relentless when fighting for a cause they believe in, and all believe that no case is too hard, no danger too dark. Dedication is what they deliver, results are their reward.</b></p> <p><b>Meet Lucifer, one of those men . . . a man with demons that run deep and dark . . .</b></p> <p><b>The only woman who can bring him to his knees . . .</b></p> <p>As one of the newest members of Walker Security, Lucifer lives up to his name. He's a man with demons that run deep and dark. A man with secrets. A man betrayed by a woman, and that betrayal has shaped every part of his life moving forward.</p> <p>He lives on the edge with fast cars, faster woman, and some might say a death wish. That is until he crossed paths with Walker Security and one of their own pulled him from the bowels of his self-created hell.</p> <p>But his own personal devil is about to show herself again. That woman from his past is back, and nothing is as it seems.</p> <p><b>Contains mature themes.</b></p>"; 
